import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component{
  // constructor(){

  // }
  render(){
    const todolist = [
      'React practice',
      'Basketball' 
    ];
    return(
      <div className="App">
      <h2>Todo List</h2>
      {
        todolist.map(item => <p>{item}</p> )
      }
    </div>
    );
  }
}


export default App;
